import { cache } from 'react'
import { Octokit } from 'octokit'
import { headers as nextHeaders } from 'next/headers'
import Image from 'next/image'
import { Cartridge } from '../libraries/home/Cartridge'

async function getKeyboardNav(userAgent: string) {
  const octokit = new Octokit({
    auth: `${process.env.GITHUB}`,
    'Content-Type': 'application/json',
    userAgent,
  })
  try {
    const { data } = await octokit.request(
      'GET /repos/scottykaye/keyboard-navigation',
      {
        owner: 'scottykaye',
        repo: 'keyboard-navigation',
      },
    )

    return data
  } catch (e) {
    console.log(`Error retrieving Github data: ${e}`)
  }
}
async function getThemeHandler(userAgent: string) {
  const octokit = new Octokit({
    auth: `${process.env.GITHUB}`,
    'Content-Type': 'application/json',
    userAgent,
  })
  try {
    const { data } = await octokit.request(
      'GET /repos/scottykaye/theme-handler',
      {
        owner: 'scottykaye',
        repo: 'keyboard-navigation',
      },
    )

    return data
  } catch (e) {
    console.log(`Error retrieving Github data: ${e}`)
  }
}

async function getStargazersData(url) {
  const fetchData = fetch(url)

  try {
    const data = await fetchData
    const response = data.json()

    return response
  } catch (e) {
    console.log(`Error retrieving Github Stargazers data: ${e}`)
  }
}
const getKeyboardNavData = cache(getKeyboardNav)
const getThemeHandlerData = cache(getThemeHandler)
const getStargazers = cache(getStargazersData)

export default async function HomePage() {
  const headers = nextHeaders()
  const [keyboardNavData, themeHandlerData] = await Promise.allSettled([
    getKeyboardNavData(headers.get('user-agent')),
    getThemeHandlerData(headers.get('user-agent')),
  ])

  let keyboardNav
  let themeHandler

  if (keyboardNavData.status === 'fulfilled') {
    keyboardNav = keyboardNavData.value
  }
  if (themeHandlerData.status === 'fulfilled') {
    themeHandler = themeHandlerData.value
  }

  const [keyboardNavStargazersData, themHandlerStargazersData] =
    await Promise.allSettled([
      await getStargazers(keyboardNav.stargazers_url),
      await getStargazers(themeHandler.stargazers_url),
    ])

  let keyboardNavStargazers = false
  let themeHandlerStargazers = false

  if (keyboardNavStargazersData.status === 'fulfilled') {
    keyboardNavStargazers = keyboardNavStargazersData.value
  }
  if (themHandlerStargazersData.status === 'fulfilled') {
    themeHandlerStargazers = themHandlerStargazersData.value
  }

  return (
    <>
      <div className="Scroll">
        <Image
          src="/images/scottykaye-bg.jpg"
          fill={true}
          placeholder="blur"
          style={{
            objectFit: 'cover',
            objectPosition: '45% center',
            zIndex: '-1',
            filter:
              'sepia(.2) brightness(.5) contrast(1.1) saturate(1.5) opacity(1)',
          }}
          className="shadow-lift top-0 !sticky !h-lvh"
          alt="Picture of Scotty Kaye"
          blurDataURL="data:image/webp;base64,"
        />
        <h1 className="Hello relative bottom-0 h-lvh grid -translate-y-full place-items-center place-content-center gap-2 p-5">
          <Image
            src="/images/scottykaye-avatar.jpg"
            width="150"
            height="150"
            placeholder="blur"
            alt="Picture of Scotty Kaye"
            blurDataURL="data:image/webp;base64,"
            className="rounded-full border border-border"
          />
          <span className="text-5xl font-bold">
            Hi,
            <span className="block">{`I'm Scotty Kaye`}</span>
          </span>
        </h1>
        <p className="About Title bg-gradient-to-bl from-white to-rose-200 max-w-3xl text-center text-balance relative top-0 grid -translate-y-full place-items-center place-content-center gap-2 p-5 mx-auto">
          {`I'm a Staff Software Engineer with a strong foundation in UX & UI.`}
        </p>
      </div>
      <section className="HomeGrid grid max-w-3xl mx-auto relative -inset-y-80 px-5">
        <h2 className="sticky mix-blend-difference bg-inverse/80 backdrop-blur top-28 z-10 p-2 mt-40 text-2xl font-bold mb-5 rounded inline-flex mr-auto">
          <span className="text-background">Projects</span>
        </h2>
        <div className="flex flex-col gap-28">
          {/*          <Project github={themeHandler} stargazers={themeHandlerStargazers} />
          <Project github={keyboardNav} stargazers={keyboardNavStargazers} />
*/}
          <Cartridge
            github={themeHandler}
            stargazers={themeHandlerStargazers}
          />
          <Cartridge github={keyboardNav} stargazers={keyboardNavStargazers} />
        </div>
      </section>
    </>
  )
}
